import React, { Component } from "react";

class EditButton extends Component {
  clickHandler() {
    console.log("edit button clicked");
  }

  render() {
    return (
      <div>
        <button onClick={this.clickHandler}>Edit</button>
      </div>
    );
  }
}

export default EditButton;
